CREATE TABLE IF NOT EXISTS "DrumLocation" ("Id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "Notes" text NULL, "DrumId" integer NULL REFERENCES "Drum" ("Id") DEFERRABLE INITIALLY DEFERRED, "EnteredBy" integer NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "LocationId" integer NULL REFERENCES "Location" ("Id") DEFERRABLE INITIALLY DEFERRED, "WinchId" integer NULL REFERENCES "Winch" ("Id") DEFERRABLE INITIALLY DEFERRED, "Date" date NULL, "WireId" integer NULL REFERENCES "Wire" ("Id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "Winch" ("Id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "Ship" text NULL, "Institution" text NULL, "Manufacturer" text NULL, "WireTrainSchematicJFrame" text NULL, "WireTrainSchematicAFrame" text NULL, "Name" text NULL, "Status" bool NULL);
CREATE TABLE IF NOT EXISTS "FactorOfSafety" ("Id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "FactorofSafety" real NOT NULL);
CREATE TABLE IF NOT EXISTS "Drum" ("Id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "InternalId" text NULL, "Color" text NULL, "Size" text NULL, "Weight" text NULL, "Material" text NULL, "WireType" text NULL);
CREATE TABLE IF NOT EXISTS "WireDrum" ("Id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "Date" date NULL, "Notes" text NULL, "WireId" integer NULL REFERENCES "Wire" ("Id") DEFERRABLE INITIALLY DEFERRED, "DrumId" integer NULL REFERENCES "Drum" ("Id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "Cruise" ("Id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "Number" text NULL, "StartDate" date NULL, "EndDate" date NULL, "ScienceProvidedWinch" text NULL, "WinchNotes" text NULL);
CREATE TABLE IF NOT EXISTS "BreakTest" ("Id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "TestedBreakingLoad" integer NULL, "Notes" text NULL, "WireId" integer NULL REFERENCES "Wire" ("Id") DEFERRABLE INITIALLY DEFERRED, "Date" date NULL);
CREATE TABLE IF NOT EXISTS "Cast" ("Id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "StartDate" datetime NOT NULL, "EndDate" datetime NULL, "Notes" text NULL, "MaxTension" integer NULL, "MaxPayout" integer NULL, "Flagforreview" bool NULL, "PayoutMaxTension" integer NULL, "DeploymentTypeId" integer NULL REFERENCES "DeploymentType" ("Id") DEFERRABLE INITIALLY DEFERRED, "EndOperatorId" integer NULL REFERENCES "WinchOperator" ("Id") DEFERRABLE INITIALLY DEFERRED, "StartOperatorId" integer NULL REFERENCES "WinchOperator" ("Id") DEFERRABLE INITIALLY DEFERRED, "WinchId" integer NULL REFERENCES "Winch" ("Id") DEFERRABLE INITIALLY DEFERRED, "WireId" integer NULL REFERENCES "Wire" ("Id") DEFERRABLE INITIALLY DEFERRED, "MeterMaxTension" integer NULL, "TimeMaxTension" datetime NULL, "DryEndTag" integer NULL, "WetEndTag" integer NULL, "MotorId" integer NULL REFERENCES "Motor" ("Id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "OwnershipStatus" ("Id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "Status" text NULL);
CREATE TABLE IF NOT EXISTS "Motor" ("Id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "Number" integer NULL);
CREATE TABLE IF NOT EXISTS "TerminationType" ("Id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "Name" text NOT NULL);
